import persion4 from "./CustomerIMG/4.jpg";
import persion5 from "./CustomerIMG/5.jpg";
import persion6 from "./CustomerIMG/6.jpg";

const TestimonialData = [
  {
    id: 1,
    imgUrl: persion1,
  },
  {
    id: 2,
    imgUrl: persion2,
  },
  {
    id: 3,
    imgUrl: persion3,
  },
  {
    id: 4,
    imgUrl: persion4,
  },
  {
    id: 5,
    imgUrl: persion5,
  },
  {
    id: 6,
    imgUrl: persion6,
  },
];
export default TestimonialData;
